import React, { useRef, useState } from 'react';
import '../assets/styles/Contact.scss';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import SendIcon from '@mui/icons-material/Send';
import TextField from '@mui/material/TextField';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';

function Contact() {

  const [name, setName] = useState<string>('');
  const [email, setEmail] = useState<string>('');
  const [message, setMessage] = useState<string>('');

  const [nameError, setNameError] = useState<boolean>(false);
  const [emailError, setEmailError] = useState<boolean>(false);
  const [messageError, setMessageError] = useState<boolean>(false);

  const form = useRef<HTMLFormElement>(null);

  const sendEmail = (e: any) => {
    e.preventDefault();

    setNameError(name === '');
    setEmailError(email === '');
    setMessageError(message === '');

    /* Uncomment below if you want to enable the emailJS */

    // if (name !== '' && email !== '' && message !== '') {
    //   var templateParams = {
    //     name: name,
    //     email: email,
    //     message: message
    //   };

    //   console.log(templateParams);
    //   emailjs.send('service_id', 'template_id', templateParams, 'api_key').then(
    //     (response) => {
    //       console.log('SUCCESS!', response.status, response.text);
    //     },
    //     (error) => {
    //       console.log('FAILED...', error);
    //     },
    //   );
    //   setName('');
    //   setEmail('');
    //   setMessage('');
    // }
  };

  return (
    <section id="contact">
      <Box className="contact-card" sx={{ maxWidth: 400, mx: 'auto', my: 6, p: 4, borderRadius: 3, boxShadow: 3, bgcolor: 'background.paper' }}>
        <Typography variant="h5" align="center" fontWeight={600} gutterBottom>
          Contact Me
        </Typography>
        <Typography variant="body2" align="center" color="text.secondary" sx={{ mb: 2 }}>
          Interested in collaborating on Flutter projects, competitive programming, or research opportunities? Let's connect!
        </Typography>
        <Divider sx={{ mb: 2 }} />
        <Box className="contact-info" sx={{ mb: 3 }}>
          <Typography variant="body2" color="text.secondary" sx={{ display: 'flex', alignItems: 'center', mb: 0.5 }}>
            <strong style={{ minWidth: 60 }}>Email:</strong> kabyasaha1812@gmail.com
          </Typography>
          <Typography variant="body2" color="text.secondary" sx={{ display: 'flex', alignItems: 'center', mb: 0.5 }}>
            <strong style={{ minWidth: 60 }}>Phone:</strong> +8801303359281
          </Typography>
          <Typography variant="body2" color="text.secondary" sx={{ display: 'flex', alignItems: 'center' }}>
            <strong style={{ minWidth: 60 }}>Location:</strong> Dhaka, Bangladesh
          </Typography>
        </Box>
        <form ref={form} onSubmit={sendEmail} autoComplete="off">
          <TextField
            label="Name"
            variant="outlined"
            size="small"
            fullWidth
            value={name}
            onChange={e => setName(e.target.value)}
            error={nameError}
            sx={{ mb: 2 }}
          />
          <TextField
            label="Email"
            variant="outlined"
            size="small"
            fullWidth
            value={email}
            onChange={e => setEmail(e.target.value)}
            error={emailError}
            sx={{ mb: 2 }}
          />
          <TextField
            label="Message"
            variant="outlined"
            size="small"
            fullWidth
            multiline
            minRows={3}
            value={message}
            onChange={e => setMessage(e.target.value)}
            error={messageError}
            sx={{ mb: 2 }}
          />
          <Button
            type="submit"
            variant="contained"
            endIcon={<SendIcon />}
            fullWidth
            sx={{ borderRadius: 2, textTransform: 'none', fontWeight: 500 }}
          >
            Send
          </Button>
        </form>
      </Box>
    </section>
  );
}

export default Contact;
